So get this: three years ago I found a great challenge, the hurdle over the bench into the step up wall run (3rd clip of this video). Back in 2019, I had tried so hard for so long and I just couldn't get it. Today I found myself facing that very same challenge...and I got it! It was not easy. I only got it twice out of many tries, but I'm so stoked that something I couldn't get in my prime was a gift saved for today instead. It's proof that parkour is not an uphill/downhill sport, but that it is truly amorphous—constantly shifting and changing, growing and receding in heterogeneous ways at various times and seasons. Not knowing what a day can or may bring has always been the most devilishly addicting quality of parkour for me, it's why I pretty much lost my life to it in the first place. Here's to many more surprising victories for all of us in the days and years to come 🍻!
